import React from "react";
import Slider from "react-slick";
import "./CardSlider.css";

const techStack = [
    "React",
    "JavaScript",
    "HTML",
    "CSS",
    "Git",
    "Node.js",
    "Express",
    "MongoDB",
    "Redux",
    "TypeScript",
    "Webpack",
    "Babel",
    "Jest",
    "GraphQL",
    "Sass",
    "Docker"
];

const CardSlider = () => {
    const settings = {
        centerMode: true,
        infinite: true,
        centerPadding: "60px",
        slidesToShow: 3,
        speed: 500,
        autoplay: true,
        autoplaySpeed: 2000,
        arrows: false,
        pauseOnHover: true
    };

    return (
        <div className="slider-container">
            <div className="fade-left"></div>
            <Slider {...settings}>
                {techStack.map((tech, index) => (
                    <div key={index} className="card">
                        <h3>{tech}</h3>
                    </div>
                ))}
            </Slider>
            <div className="fade-right"></div>
        </div>
    );
};

export default CardSlider;
